import React from 'react';
import styled from 'styled-components';

const RecommandListBlock = styled.div`
  width: 100%;
  height: 400px;
  border: 1px solid black;
`;

const RecommandList = () => {
  return <RecommandListBlock>추천 리스트</RecommandListBlock>;
};

export default RecommandList;
